public class InnerClusterClusterConfigurationFactory(Action<Humidifier.ECS.ClusterTypes.ClusterConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.ECS.ClusterTypes.ClusterConfiguration>
{

    internal InnerClusterManagedStorageConfigurationFactory ManagedStorageConfigurationFactory { get; set; }

    internal InnerClusterExecuteCommandConfigurationFactory ExecuteCommandConfigurationFactory { get; set; }

    protected override Humidifier.ECS.ClusterTypes.ClusterConfiguration Create()
    {
        var clusterConfigurationResult = CreateClusterConfiguration();
        factoryAction?.Invoke(clusterConfigurationResult);

        return clusterConfigurationResult;
    }

    private Humidifier.ECS.ClusterTypes.ClusterConfiguration CreateClusterConfiguration()
    {
        var clusterConfigurationResult = new Humidifier.ECS.ClusterTypes.ClusterConfiguration();

        return clusterConfigurationResult;
    }
    public override void CreateChildren(Humidifier.ECS.ClusterTypes.ClusterConfiguration result)
    {
        base.CreateChildren(result);

        result.ManagedStorageConfiguration ??= ManagedStorageConfigurationFactory?.Build();
        result.ExecuteCommandConfiguration ??= ExecuteCommandConfigurationFactory?.Build();
    }

} // End Of Class

